void loadCompressedChar(int &otwidth, int &otheight, int *tpix) {
  otheight = *(ftv++);
  otwidth = *(ftv++);
  int left = otwidth * otheight;
  while(left) {
    int x = *(ftv++);
    if(x == 0 || x == 255) {
      x = x * 0x1010101;
      int q = *(ftv++);
      left -= q;
      while(q--) *(tpix++) = x;
      }
    else {
      *(tpix++) = (x << 24) | 0xFFFFFF;
      left--;
      }
    }
  }

